using Test, PolynomialOptimization.SimplePolynomials, PolynomialOptimization.Solver, LinearAlgebra
using JuliaInterpreter # we choose to interpret the callback functions, so that the whole testsuite can run in ~35 minutes. The compilation cost is quite enormous, so not doing this would lead extremely long run times even for single tests.
using PolynomialOptimization.Solver: PSDIndextype
using PolynomialOptimization: sort_along!

const sqrt2 = sqrt(BigFloat(2))

function checkequality(indvals, supposed_indices, supposed_values, exact::Bool=false)
    # we don't have any guarantee that the indices are ordered, and we must keep their order
    indices, values = indvals.indices, indvals.values
    # sometimes, cancellations may happen that will give rise to explicit zeros, but the test code generation will have them dropped
    keeppos_unsorted = findall(!iszero, values)
    @views keeppos = keeppos_unsorted[sortperm(indices[keeppos_unsorted])]
    @views return indices[keeppos] == supposed_indices && (exact ? values[keeppos] == supposed_values : isapprox(values[keeppos], supposed_values, atol=1e-13))
end

function checkequality(rows, supposed_rows, cols, supposed_cols, values, supposed_values)
    sort_along!(rows, cols, values, relevant=2)
    sort_along!(supposed_rows, supposed_cols, supposed_values, relevant=2)
    keeppos = findall(!iszero, values)
    @views return rows[keeppos] == supposed_rows && cols[keeppos] == supposed_cols && values[keeppos] == supposed_values
end

macro checkequals(lowerind, lowerval, upperind, upperval, fullind, fullval)
    esc(quote
        if tri === :L
            @test checkequality(iter[1], $lowerind, $lowerval)
        elseif tri === :U
            @test checkequality(iter[1], $upperind, $upperval)
        else
            @test checkequality(iter[1], $fullind, $fullval, true)
        end
        iter = iterate(data, iter[2])
    end)
end

macro checkequals(ind, lowerrows, lowercols, lowervals)
    esc(quote
        # it may rarely happen that we end up with a all-zeros entry, which would not be present in the test
        while iter[1].first < $ind && all(iszero, iter[1].second[3])
            iter = iterate(data, iter[2])
        end
        @test iter[1].first == $ind
        if tri === :L
            @test checkequality(iter[1].second[1], $lowerrows, iter[1].second[2], $lowercols, iter[1].second[3], $lowervals)
        else
            @test checkequality(iter[1].second[1], $lowercols, iter[1].second[2], $lowerrows, iter[1].second[3], conj.($lowervals))
        end
        iter = iterate(data, iter[2])
    end)
end

macro checkequals(fullind, fullval, exact=:true)
    esc(quote
        @test checkequality(iter[1], $fullind, $fullval, $exact)
        iter = iterate(data, iter[2])
    end)
end

macro skipempty()
    esc(quote
        if !isnothing(iter) && (isempty(iter[1]) || all(ComposedFunction(iszero, last), iter[1]))
            iter = iterate(data, iter[2])
        end
    end)
end

abstract type AbstractSolverSetup <: Solver.AbstractSolver{BigInt,BigFloat} end

mutable struct MomentSolverSetup{Linear,RQuadratic,PSD,Complex,Fixed} <: AbstractSolverSetup
    const instance::Int
    lastcall::Symbol
    const fixed_available::Set{UInt}

    function MomentSolverSetup(instance::Int; linear::Bool=false, rquadratic::Bool=false,
        psd::Union{Bool,<:PSDIndextype}=false, complex::Bool=false, fixed::Bool=false)
        @assert psd !== true
        new{linear,rquadratic,psd,complex,fixed}(instance, :none, Set{UInt}())
    end
end

mutable struct SOSSolverSetup{Linear,Quadratic,RQuadratic,DD,L1,SDD,Complex} <: AbstractSolverSetup
    const instance::Int
    lastcall::Symbol
    it::Int
    const representation::Solver.RepresentationMethod
    const free_available::Set{UInt}
    
    function SOSSolverSetup(instance::Int; linear::Bool=false, quadratic::Bool=false, rquadratic::Bool=false,
        dd::Union{Bool,<:PSDIndextype}=false, l1::Bool=false, sdd::Union{Bool,<:PSDIndextype}=false, complex::Bool=false,
        representation::Solver.RepresentationMethod)
        new{linear,quadratic,rquadratic,dd,l1,sdd,complex}(instance, :none, 0, representation, Set{UInt}())
    end
end

Solver.mindex(::AbstractSolverSetup, monomials::SimpleMonomialOrConj...) = BigInt(monomial_index(monomials...) + 48)

Solver.supports_quadratic(        ::MomentSolverSetup                 ) = false
Solver.supports_rotated_quadratic(::MomentSolverSetup{<:Any,s        }) where {s} = s
Solver.supports_psd_complex(      ::MomentSolverSetup{<:Any,<:Any,s,c}) where {s,c} = s !== false && c
