Solver.supports_dd(               ::SOSSolverSetup{<:Any,<:Any,<:Any,s                  }) where {s} = s !== false
Solver.supports_dd_complex(       ::SOSSolverSetup{<:Any,<:Any,<:Any,s,    <:Any,<:Any,c}) where {s,c} = s !== false && c
