function momenttest(instance, grouping, constraint, type)
    if type === :moment_linear
        states = (MomentSolverSetup(instance, linear=true),)
    elseif type === :moment_rquadratic
        states = (MomentSolverSetup(instance, rquadratic=true),)
    elseif type === :moment_psdr
        states = (MomentSolverSetup(instance, psd=PSDIndextypeVector(:L)),
                  MomentSolverSetup(instance, psd=PSDIndextypeVector(:U)),
                  MomentSolverSetup(instance, psd=PSDIndextypeVector(:F)),
                  MomentSolverSetup(instance, psd=PSDIndextypeMatrixCartesian(:L, 17)),
                  MomentSolverSetup(instance, psd=PSDIndextypeMatrixCartesian(:U, 17)))
    elseif type === :moment_psdc
        states = (MomentSolverSetup(instance, psd=PSDIndextypeVector(:L), complex=true),
                  MomentSolverSetup(instance, psd=PSDIndextypeVector(:U), complex=true),
                  MomentSolverSetup(instance, psd=PSDIndextypeVector(:F), complex=true),
                  MomentSolverSetup(instance, psd=PSDIndextypeMatrixCartesian(:L, 17), complex=true),
                  MomentSolverSetup(instance, psd=PSDIndextypeMatrixCartesian(:U, 17), complex=true))
    elseif type === :moment_equality
        state = MomentSolverSetup(instance, fixed=true)
        moment_add_equality!(state, grouping, constraint)
        @test state.lastcall === :add_constr_fix_finalize
        return
    else
        @assert(false)
    end
    for state in states
        moment_add_matrix!(state, grouping, constraint)
        @test state.lastcall === type
    end
    return
end

function sostest(instance, grouping, constraint, type)
    ud = Diagonal(1:100)
    uf = reshape(1:100^2, 100, 100)
    udc = Diagonal(reinterpret(reshape, Complex{Int}, reshape(1:200, 2, 100)))
    ufc = reinterpret(reshape, Complex{Int}, reshape(1:2*100^2, 2, 100, 100))
    if type === :sos_ddr
        states = (SOSSolverSetup(instance; dd=PSDIndextypeVector(:U), complex=true, representation=Solver.RepresentationDD(complex=false)),
                  SOSSolverSetup(instance; l1=true, representation=Solver.RepresentationDD()),
                  SOSSolverSetup(instance; linear=true, representation=Solver.RepresentationDD()),

                  SOSSolverSetup(instance +1; l1=true, representation=Solver.RepresentationDD(ud)),
                  SOSSolverSetup(instance +1; linear=true, representation=Solver.RepresentationDD(ud)),

                  SOSSolverSetup(instance +2; l1=true, representation=Solver.RepresentationDD(uf)),
                  SOSSolverSetup(instance +2; linear=true, representation=Solver.RepresentationDD(uf)))
    elseif type === :sos_ddc
        states = (SOSSolverSetup(instance; dd=PSDIndextypeVector(:U), complex=true, representation=Solver.RepresentationDD()),
                  SOSSolverSetup(instance; l1=true, complex=true, representation=Solver.RepresentationDD()),
                  SOSSolverSetup(instance +1; quadratic=true, representation=Solver.RepresentationDD()),

                  SOSSolverSetup(instance +2; l1=true, complex=true, representation=Solver.RepresentationDD(udc)),
                  SOSSolverSetup(instance +3; quadratic=true, representation=Solver.RepresentationDD(udc)),
                  
                  SOSSolverSetup(instance +4; l1=true, complex=true, representation=Solver.RepresentationDD(ufc)),
                  SOSSolverSetup(instance +5; quadratic=true, representation=Solver.RepresentationDD(ufc)))
    elseif type === :sos_sddr
        states = (SOSSolverSetup(instance, sdd=PSDIndextypeVector(:U), representation=Solver.RepresentationSDD(complex=false)),
                  SOSSolverSetup(instance, rquadratic=true, representation=Solver.RepresentationSDD(complex=false)),
                  SOSSolverSetup(instance, quadratic=true, representation=Solver.RepresentationSDD(complex=false)),

                  SOSSolverSetup(instance +1, rquadratic=true, representation=Solver.RepresentationSDD(ud, complex=false)),
                  SOSSolverSetup(instance +1, quadratic=true, representation=Solver.RepresentationSDD(ud, complex=false)),

                  SOSSolverSetup(instance +2, rquadratic=true, representation=Solver.RepresentationSDD(uf, complex=false)),
                  SOSSolverSetup(instance +2, quadratic=true, representation=Solver.RepresentationSDD(uf, complex=false)))
    elseif type === :sos_sddc
        states = (SOSSolverSetup(instance, sdd=PSDIndextypeVector(:U), complex=true, representation=Solver.RepresentationSDD()),
                  SOSSolverSetup(instance, rquadratic=true, complex=true, representation=Solver.RepresentationSDD()),
                  SOSSolverSetup(instance, quadratic=true, complex=true, representation=Solver.RepresentationSDD()),

                  SOSSolverSetup(instance +1, rquadratic=true, complex=true, representation=Solver.RepresentationSDD(udc)),
                  SOSSolverSetup(instance +1, quadratic=true, complex=true, representation=Solver.RepresentationSDD(udc)),

                  SOSSolverSetup(instance +2, rquadratic=true, complex=true, representation=Solver.RepresentationSDD(ufc)),
                  SOSSolverSetup(instance +2, quadratic=true, complex=true, representation=Solver.RepresentationSDD(ufc)))
    else
        @assert(false)
    end
    for state in states
        sos_add_matrix!(state, grouping, constraint, state.representation)
        @test state.lastcall === type
    end
    return
end

function isinterpreted()
    # These are harmless in the compiled case; and the interpreter will always remove them.
    # While we could also check whether @inbounds has any effect, this is influenced by the command line parameters.
    x = Base.@_gc_preserve_begin nothing
    result = isnothing(x)
    Base.@_gc_preserve_end x
    return result
end

maybeinterpret_helper(::Val{true}, @nospecialize(fn), args...) = fn(args...)
maybeinterpret_helper(::Val{false}, @nospecialize(fn), args...) = @interpret fn(args...)
macro maybeinterpret(expr)
    expr.head === :call || error("Invalid use of @maybeinterpret")
    esc(:(maybeinterpret_helper(Val(isinterpreted()), $(expr.args...))))
end

