function Solver.add_constr_slack!(state::Union{<:SOSSolverSetup{false,false,false,false,true,false},SOSSolverSetup{true,false,false,false,false,false,false},<:SOSSolverSetup{false,true,false,false,false,false},<:SOSSolverSetup{false,false,true,false,false,false}}, num::Int)
    @test state.lastcall === :none
    state.lastcall = :sos_slack
    if (in(state.instance, (1,2,3)) && num == 21) || 
        (in(state.instance, (4,5,6)) && num == 10) || 
        (in(state.instance, (7,8,9)) && num == 78) || 
        (in(state.instance, (10,11,12,16,17,18,19,20,21)) && num == 144) || 
        (in(state.instance, (13,14,15)) && num == 16)
        return BigInt(-num):BigInt(-1)
    else
        @test false
    end
end

function Solver.add_var_free_prepare!(state::Union{<:SOSSolverSetup{false,false,false,false,true,false},SOSSolverSetup{true,false,false,false,false,false,false},<:SOSSolverSetup{false,true,false,false,false,false},<:SOSSolverSetup{false,false,true,false,false,false}}, num::Int)
    @test state.lastcall === :sos_slack
    @test isempty(state.free_available)
    state.lastcall = :add_var_free
    union!(state.free_available, UInt(1):UInt(num))
    return UInt(num)
end

function Solver.add_var_free_finalize!(state::Union{<:SOSSolverSetup{false,false,false,false,true,false},SOSSolverSetup{true,false,false,false,false,false,false},<:SOSSolverSetup{false,true,false,false,false,false},<:SOSSolverSetup{false,false,true,false,false,false}}, eqstate::UInt)
    @test state.lastcall === :add_var_free
    state.lastcall = :add_var_free_finalize
    @test iszero(eqstate)
    @test isempty(state.free_available)
end

