    @test state.lastcall === :none
    state.lastcall = :sos_sddr
    if state.instance == 1
        @test dim == 6
        iter = iterate(data)
        @checkequals(BigInt[52], BigFloat[6], BigInt[52], BigFloat[6], BigInt[52], BigFloat[6])
